import React from 'react'
import { Typography, Avatar, Grid, Box } from '@material-ui/core'
import Typed from 'react-typed'
import avatar from '../avatar.jpeg'

const Header = () => {
    return (
        <Box>
            <Avatar src={avatar} alt='Tianyu Cao' />
            <Typography variant='h4'>
                <Typed strings={['Tianyu Cao']} typeSpeed={40} />
            </Typography>
            <br />
            <Typography variant='h5'>
                <Typed
                    strings={['Web Development', 'Front-End Engineer', 'Full-Stack Engineer']}
                    typeSpeed={40}
                    backSpeed={60}
                />
            </Typography>
        </Box>
    )
}

export default Header
